// Assignments.js
import React from 'react';

const Assignments = () => {
  return (
    <section>
      <h2>Assignments</h2>
      <ul>
        <li>Color your keyboard 1: Due on 08/07/2023</li>
        <li>Login into Google classroom from home 2: Due on 08/15/2023</li>
        <li>Typing practice 3: Due Nightly</li>
        <li>Work on introduction presentation 4: Due on 08/20/2023</li>
      </ul>
    </section>
  );
};

export default Assignments;
